import React, {useEffect,useState, useContext} from 'react';
import axios from 'axios';
import { Server } from '../index';
import '../css/database.css';
import labels from '../labels.json' ;

export default function Database(){

    const [startDate,setStartDate] = useState("")
    const [endDate,setEndDate] = useState("")

    const [minLength,setMinLength] = useState("")
    const [maxLength,setMaxLength] = useState("")

    const [language,setLanguage] = useState(null)
    const [correction,setCorrection] = useState(null)
    const [comment,setComment] = useState(null)
    const [words,setWords] = useState(null)

    const [data,setData] = useState([])
    const server = useContext(Server)

    useEffect(()=>{
        const fetchData = async ()=>{
            try {
                const response = await axios.get(server+'database')
                setData(response.data)
                console.log(response.data)
            }
            catch(error){

            }
        };
        fetchData()
    },[])


    function search(){
        const filter ={
            startDate:startDate,
            endDate: endDate,
            minLength: minLength,
            maxLength:maxLength,
            language: language,
            correction: correction,
            comment: comment,
            words: words
        }

        console.log(filter)        
    }

    function extractWords(e) {
        const regex = /"[^"]*"|[^",;\s]+/g;
        console.log(e.target.value.match(regex))

    }
    return(
        <div>
            <div className='search-bar'>

                <div className='filter-option'>
                    <input type='checkbox' id='date'></input><b>Date: </b>
                    <div className='filter-inputs'>
                        <span>from:</span>
                        <input type='date' id="from-date" value={startDate} onChange={(e)=>{setStartDate(e.target.value)}}></input>
                        <br/>
                        <span>to:</span>
                        <input type='date' id="to-date" value={endDate} onChange={(e)=>{setEndDate(e.target.value)}}></input>

                    </div>
                </div>

                <div className='filter-option'>
                    <input type='checkbox' id='date'></input><b>Length: </b>
                    <div className='filter-inputs'>
                        <span>from:</span>
                        <input type='number' id="min-length" style={{width: '6vw'}} min={1}
                        value={minLength} onChange={(e)=>{setMinLength(e.target.value)}}></input>
                        <br/>
                        <span>to:</span>
                        <input type='number' id="max-length" style={{width: '6vw'}} min={1}
                        value={maxLength} onChange={(e)=>{setMaxLength(e.target.value)}}></input>

                    </div>
                </div>

                <div className='filter-option'>
                    <input type='checkbox' id='date'></input><b>Language: </b>
                    <div className='filter-inputs'>
                        <br/>
                        <select id="select-language" onChange={(e)=>setLanguage(e.target.value)}>
                            {labels.language.map((x)=>
                                <option key={x} value={x}>
                                    {x}
                                </option>
                    )}
                        </select>                       
                    </div>
                </div>

                <div className='filter-option'>
                    <input type='checkbox' id='date'></input><b>Correction: </b>
                    <div className='filter-inputs'>                        
                        <span>has correnction</span> 
                        <input type='radio' id="correction-provided" name="correction" 
                        onChange={(e)=>setCorrection(1)}></input>   
                        <br/>
                        <span>no correnction</span> 
                        <input type='radio' id="correction-not-provided" name="correction"
                        onChange={(e)=>setCorrection(0)}></input>                                                                  
                    </div>
                </div>

                <div className='filter-option'>
                    <input type='checkbox' id='date'></input><b>Comment: </b>
                    <div className='filter-inputs'>
                        <span>has comment</span> 
                        <input type='radio' id="comment-provided" name="comment" onChange={(e)=>setComment(0)}></input>   
                        <br/>
                        <span>no comment</span> 
                        <input type='radio' id="comment-not-provided" name="comment" onChange={(e)=>setComment(1)} ></input>  


                    </div>
                </div>

                <div className='filter-option'>
                    <input type='checkbox' id='date'></input><b>Key Words: </b>
                    <div className='filter-inputs'>
                        <br/>
                        <input type='text' style={{ maxWidth:'12vw'}} onClick={extractWords}/>

                    </div>
                </div>

                <button className='search-button' onClick={search}>Search</button>           


                <div className='clearfix'></div>
             </div>
             <div className='content'>

                <div className='clearfix'></div>
             </div>
        </div>
    )
}
